import React, { useEffect, useContext } from "react";
import { PetsContext } from "../../App";
import { Container, PetsCard } from "./styles";

export default function HomePage() {
  const { pets = [], getPets } = useContext(PetsContext);

  useEffect(() => {
    getPets();
  }, []);

  return (
    <Container>
      {pets.map((e) => {
        return (
          <PetsCard key={e.id}>
            <p>name : {e.name}</p>
            <p>age : {e.age}</p>
            <p>location : {e.location}</p>
            <p>breed : {e.breed}</p>
          </PetsCard>
        );
      })}
    </Container>
  );
}
